import React from 'react';
import logo from './logo.svg';
import './App.css';

import CompanionApp from './containers/CompanionApp';
import Header from './components/Header';

import { Container, Col, Row} from 'react-bootstrap';

function App() {
  return (
    <Container> 
      <Row>
        <Header/>
        <CompanionApp />
      </Row>
    </Container>
  );
}

export default App;


